import React, { Component } from 'react';

class CurrentWeather extends Component {
    constructor(props) {
        super(props);
        this.state = {

        }; 
      } 


    render() { 
        return ( 
            <div className="current">
          <h2>Current Weather</h2>
          <h3>City: {this.props.location}</h3>
                <ul>    
                <li>Main:{this.props.currentWeather['main']}</li>
                <li>Description:{this.props.currentWeather['description']}</li>
                <li>Icon:
                <img src={`http://openweathermap.org/img/w/${this.props.currentWeather['icon']}.png`}/>
                </li>
                <li>Temp:{Math.ceil(this.props.currentWeatherTemps['temp'])}</li>
                <li>Feels Like:{Math.ceil(this.props.currentWeatherTemps['feels_like'])}</li>
                <li>Humidity:{this.props.currentWeatherTemps['humidity']}</li>
                <li>Wind:{this.props.currentWind}</li>
                <li>Sunrise: {this.props.sunrise}</li>
                <li>Sunset: {this.props.sunset}</li>
                </ul>
            </div> 
         );


    }
}

export default CurrentWeather;
